    @Spy
    private ObjectMapper objectMapper = new ObjectMapper();

    @InjectMocks
    private AllianzV1Mapper allianzV1Mapper;

    @BeforeEach
    void setUp() {
        // Initialize Mockito annotations
        MockitoAnnotations.openMocks(this);
    }

    @Test
    void given_good_payload_when_map_then_return_right_object() {

        // When
        Optional<AllianzV1> result = allianzV1Mapper.map(goodPayload);

        // Then
        assertTrue(result.isPresent());
        AllianzV1 allianzV1 = result.get();
        assertEquals(9, allianzV1.getDatiImmatricolazioni().size());
        assertEquals(4, allianzV1.getDatiAttestati().size());
        assertEquals(10, allianzV1.getDatiCoperture().size());

        AllianzV1.DatiImmatricolazioni di = allianzV1.getDatiImmatricolazioni().get(3);
        assertEquals("4.050  kg", di.getTara());

        AllianzV1.DatiAttestati da = allianzV1.getDatiAttestati().get(2);
        assertEquals("FE554YK", da.getTargaTelaio());

        AllianzV1.DatiCoperture dc = allianzV1.getDatiCoperture().get(5);
        assertEquals("02/11/2021", dc.getDataIncasso());
    }

    @Test
    void given_bad_payload_when_map_then_return_empty() {

        // When
        Optional<AllianzV1> result = allianzV1Mapper.map("giogg-.%");

        // Then
        assertTrue(result.isEmpty());
    }

